import { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

function Home() {
  return (
    <body>
      <nav class="navbar">
        <button
          class="navbar-toggler"
          type="button"
          aria-label="Toggle navigation"
        >
          <span class="navbar-toggler-icon"></span>
        </button>
        <ul>
          <li>test</li>
          <li>teste</li>
          <li>teste</li>
          <li>teste</li>
        </ul>
      </nav>
      <h1>TESTE!</h1>
    </body>
  );
}

export default Home;
